orkers, and campus partners in all dealings.', 'levelBg'), ('175', '39', '5', 'Exceptional', '5', 'Is looked up to and highly respected by customers, coworkers and the campus community.', 'levelBg'), ('176', '40', '0', '(not set)', '0', '(no value)', 'levelBg'), ('177', '40', '1', 'Unsatisfactory', '1', 'Is not welcoming or respectful; coworkers and campus partners often work around to avoid interaction. ', 'levelBg'), ('178', '40', '2', 'Improvement Needed', '2', 'Is reticent to include new people or ideas.', 'levelBg'), ('179', '40', '3', 'Meets Expectations', '3', 'Inclusive and open to new people and ideas.', 'levelBg'), ('180', '40', '4', 'Exceeds Expectations', '4', 'Includes and welcomes diverse individuals and groups.', 'levelBg'), ('181', '40', '5', 'Exceptional', '5', 'Actively creates an inclusive and welcoming environment for diverse\nindividuals and groups across campus.', 'levelBg'), ('182', '41', '0', '(not set)', '0', '(no value)', 'levelBg'), ('183', '41', '1', 'Unsatisfactory', '1', 'Discourages different points of view; becomes defensive when asked to consider\nnew/different ideas.', 'levelBg'), ('184', '41', '2', 'Improvement Needed', '2', 'Is not always open to different points of view.', 'levelBg'), ('185', '41', '3', 'Meets Expectations', '3', 'Seeks to understand and incorporate different points of view.', 'levelBg'), ('186', '41', '4', 'Exceeds Expectations', '4', 'Is consistently open to and respectful of different points of view.', 'levelBg'), ('187', '41', '5', 'Exceptional', '5', 'Promotes equity and inclusion by actively seeking ideas and insights\nfrom diverse sources.', 'levelBg'), ('188', '42', '0', '(not set)', '0', '(no value)', 'levelBg'), ('189', '42', '1', 'Unsatisfactory', '1', 'Neither understands nor promotes opportunities to experience diversity in the organization.', 'levelBg'), ('190', '42', '2', 'Improvement Needed', '2', 'Needs to develop understanding and awareness of opportunities to learn about and experience diversity in the organization.', 'levelBg'), ('191', '42', '3', 'Meets Expectations', '3', 'Understands and promotes opportunities to experience diversity in the organization for self and others.', 'levelBg'), ('192', '42', '4', 'Exceeds Expectations', '4', 'Participates in range of opportunities to learn about and experience diversity in the organization; encourages others to do the same.', 'levelBg'), ('193', '42', '5', 'Exceptional', '5', 'Actively creates opportunities for others to learn about and experience diversity in the organization.', 'levelBg'), ('194', '43', '0', '(not set)', '0', '(no value)', 'levelBg'), ('195', '43', '1', 'Unsatisfactory', '1', 'Mobilizes appropriate resources in response to situations that have the potential to negatively impact patient/family outcomes.\nRecognizes ethical issues and seeks assistance in addressing them.\n', 'levelBg'), ('196', '43', '2', 'Improvement Needed', '2', 'Challenges situations and/or decisions that obstruct positive patient outcomes and works to reduce barriers. Anticipates patient/family needs.\n', 'levelBg'), ('197', '43', '3', 'Meets Expectations', '3', '***Challenges and adapts systems to maximize the benefits for patient care.\n', 'levelBg'), ('198', '43', '4', 'Exceeds Expectations', '4', '(no value)', 'levelBg'), ('199', '43', '5', 'Exceptional', '5', 'Recognizes role of each member of the health care team.\nAware of importance of team collaboration and with guidance begins to initiate collaborative communication.\nInitiates referrals.\nRecognizes the impact of ones behavior on others.\n', 'levelBg'), ('200', '44', '0', '(not set)', '0', 'Initiates, recognizes and values professional collaborative communication and the positive effect on patient outcomes. Identifies and utilizes collaborative resources.\nMonitors referrals.\n', 'levelBg'), ('201', '44', '1', 'Unsatisfactory', '1', 'Is sought out by members of the multi-disciplinary health care team.\nFrequently initiates consults with health care team.\nActively collaborates with other health professionals in delivering care.\nRecognizes need and calls for team conference.\nActs as resource to nursing and health care team.\n', 'levelBg'), ('202', '44', '2', 'Improvement Needed', '2', 'Through shared values and a clear professional identify, demonstrates and role models an interdisciplinary collaborative approach to patient care.\nParticipates and/or leads team care conference.\n', 'levelBg'), ('203', '44', '3', 'Meets Expectations', '3', '(no value)', 'levelBg'), ('204', '44', '4', 'Exceeds Expectations', '4', 'Identifies self as member of nursing and health care teams. Begins to generate trust, respect, and compassion within the workgroup.\nTakes responsibility for developing beginning team relationships.\nSeeks assistance with resolving conflict. Meets professional commitments consistently.\nAsks for and accepts help when needed.\n', 'levelBg'), ('205', '44', '5', 'Exceptional', '5', 'Functions as an independent and supportive team member. Provides assistance to others. Demonstrates empathy and compassion in interactions with team members.\nApproaches conflict situations in a constructive manner.\n', 'levelBg'), ('206', '45', '0', '(not set)', '0', 'Fosters mutual regard, respect, and trust.\nDemonstrates flexibility.\nCreates conditions and relationships that promote creative, innovative, and positive processes and outcomes.\nRole models behaviors that demonstrate compassion and caring.\nFosters others development of conflict resolution skills.\nDemonstrates active engagement to enhance patient care and promote a positive workplace.\n', 'levelBg'), ('207', '45', '1', 'Unsatisfactory', '1', 'Demonstrates team values that orient people to care about performance and success of others.\nRecognizes value of conflict in individual and organization learning and growth.\n', 'levelBg'), ('208', '45', '2', 'Improvement Needed', '2', '(no value)', 'levelBg'), ('209', '45', '3', 'Meets Expectations', '3', 'Engages in self assessment related to orientation and ongoing learning needs and seeks out unit resources to assist in meeting needs.\nCompletes mandatory/ competency requirements during orientation and annually.\n', 'levelBg'), ('210', '45', '4', 'Exceeds Expectations', '4', 'Sets goals for knowledge/ skill enhancement within the practice setting.\nSeeks out additional learning experiences within practice area:  Unit specific certifications  Consultation with experts  Inservices/rounds  Collaborates with multidisciplinary team\n', 'levelBg'), ('211', '45', '5', 'Exceptional', '5', '***Sets goals for knowledge/skill enhancement within and beyond the practice setting.\n***Attends inservice(s)/CE within and beyond practice area.\n', 'levelBg'), ('212', '46', '0', '(not set)', '0', '***Sets goals in self directed manner and actively seeks out opportunities for knowledge/skill enhancement within and beyond the practice setting.\n***Evidence of advancing professional identify (at least one):  Certification in specialty (ACCN, ANCC Specialty Areas)  Active participation in Professional organization (i.e., clinical specialty organizations, UMPNC, MNA, ANA, UAN)  Active membership/ leadership role in institutional groups related to nursing\n', 'levelBg'), ('213', '46', '1', 'Unsatisfactory', '1', '(no value)', 'levelBg'), ('214', '46', '2', 'Improvement Needed', '2', 'Has knowledge of and supports established nursing improvement projects/endeavors in practice setting.\n', 'levelBg'), ('215', '46', '3', 'Meets Expectations', '3', 'Identifies areas for creative improvement in practice setting and seeks out resources and avenues to address them (unit practice council, content experts, etc.).\n', 'levelBg'), ('216', '46', '4', 'Exceeds Expectations', '4', 'Takes on leadership role in relation to innovations/ improvements in practice setting. Reads evidence based articles related to area of practice.\n', 'levelBg'), ('217', '46', '5', 'Exceptional', '5', 'Independently seeks out opportunities to share information and influence evidence based nursing practice.\nEvaluates effectiveness of innovation/practice challenges.\n', 'levelBg'), ('218', '47', '0', '(not set)', '0', '(no value)', 'levelBg'), ('219', '47', '1', 'Unsatisfactory', '1', 'Reads clinical articles. Participates in unit/area based Continuous Quality Improvement projects.\n', 'levelBg'), ('220', '47', '2', 'Improvement Needed', '2', 'Demonstrates an awareness of current literature in area of practice, including journal club, inservices, etc.\nIdentifies individual patient problems which require investigation. Participates in unit/area based research, as appropriate.\n', 'levelBg'), ('221', '47', '3', 'Meets Expectations', '3', '***Participates in unit/area based/institutional Continuous Quality Improvement projects.\nPresents at unit based educational forums.\n', 'levelBg'), ('222', '47', '4', 'Exceeds Expectations', '4', 'Implements change in practice for a population of patients based on the application of current research findings and evaluates effectiveness of practice changes.\nMakes recommendations for changes in practice based on findings. ***Shares findings of Continuous Quality Improvement projects, such as:  Unit presentation  Rounds  Poster  Publishing\nApplies current literature/ research to problems in practice area.\n', 'levelBg'), ('573', '47', '5', 'Exceptional', '5', '(no value)', 'levelBg'), ('574', '48', '0', '(not set)', '0', 'The requirements are not met.', 'levelBg'), ('575', '48', '1', 'Unsatisfactory', '1', 'Progress is being made toward completion of the requirements.', 'levelBg'), ('576', '48', '2', 'Improvement Needed', '2', 'Requirements have been met.', 'levelBg'), ('577', '48', '3', 'Meets Expectations', '3', 'Requirements have been met and exceeded.', 'levelBg'), ('578', '48', '4', 'Exceeds Expectations', '4', '(no value)', 'levelBg'), ('579', '48', '5', 'Exceptional', '5', 'The requirements are not met.', 'levelBg'), ('580', '49', '0', '(not set)', '0', 'Progress is