INSERT INTO `question_group` VALUES ('24', '5', 'Inclusiveness', 'A', '1', 'Shows respect for people and their differences;	promotes fairness and	equity;	engages	\nthe	talents, experiences and capabilities of others; fosters a sense	of	belonging;	works	\nto	understand the	perspectives of	others;	and	creates	opportunities	for	access	and	\nsuccess.', null), ('25', '5', 'Stewardship', 'B', '2', 'Implements	a	process	or	takes	some	action	that	significantly	reduces	risk	on	campus	\n(e.g.,	making	information	for	decision-making	more	accessible,	reliable,	consistent and\nsecure;	supporting	continuity	planning	or	emergency	preparedness;	etc.).', null), ('26', '5', 'Problem Solving and Decision Making', 'C', '3', 'Problem	solving	 Identifies	problems,	involves	others	in	seeking	solutions,	conducts	\nappropriate	analyses,	searches	for	best	solutions;	responds	quickly	to	new	challenges.	\nDecision-making	 Makes	clear,	consistent,	transparent	decisions;	acts	with	integrity	in	\nall	decision	making;	distinguishes	relevant	from	irrelevant	information	and	makes	\ntimely	decisions.', null), ('27', '5', 'Strategic Planning and Organizing', 'D', '4', 'Understands	big	picture	and	aligns	priorities	with	broader	goals,	measures	outcomes,	\nuses	feedback	to	change	as	needed,	evaluates	alternatives,	solutions	oriented,	seeks	\nalternatives	and	broad	input; can	see	connections	within	complex	issues.', null), ('28', '5', 'Communication', 'E', '5', 'Connects	with	peers,	subordinates	and	customers,	actively	listens,	clearly	and	\neffectively	shares	information,	demonstrates	effective	oral	and	written	communication	\nskills.', null), ('38', '5', 'Quality Improvement', 'F', '6', 'Strives	for	efficient,	effective,	high	quality	performance	in	self	and	the	unit;	delivers	\ntimely	and	accurate	results;	resilient	when	responding	to	situations	that	are	not	going	\nwell;	takes	initiative	to	make	improvements.', null), ('39', '9', 'Leadership', 'G', '7', 'Accepts	responsibility	for	own	work;	develops	trust	and	credibility;	demonstrates	\nhonest	and	ethical	behavior.', null), ('40', '9', 'Teamwork', 'H', '8', 'Cooperates	and	collaborates	with	colleagues	as	appropriate;	works	in	partnership	with	\nothers.', null), ('41', '9', 'Service Focus', 'I', '9', 'Values	the	importance	of	delivering	high	quality,	innovative	service	to	internal	and	\nexternal	clients;	understands	the	needs	of	the	client;	customer	service	focus.', null), ('42', '9', 'Managing People', 'J', '10', 'Coaches,	evaluates,	develops,	inspires	people;	sets	expectations,	recognizes	\nachievements,	manages	conflict,	aligns	performance	goals	with	university	goals,	\nprovides	feedback,	group	leadership;	delegates.', null);
COMMIT;

